from typing import *
import copy
class Solution:
    # submitted solution
    def jumps2(self, arr):
        if(len(arr) == 1):
            return 0
        if not self.jumps:
            return len(arr) - 1
        goal = len(arr)-1
        steps = 0
        visited = [goal]
        locations = [goal]
        found = False
        while(not found):
            if(len(locations) == 0):
                break
            # print('Exploring ', locations)
            newLocations = []
            steps += 1
            for pos in locations:
                if(pos + 1 < len(arr)):
                    # if(pos+1 == 0):
                    #     found = True
                    #     break
                    newLocations.append(pos+1)
                if(pos - 1 >= 0):
                    # if(pos-1 == 0):
                    #     found = True
                    #     break
                    newLocations.append(pos-1)
                tmp = copy.deepcopy(self.table[arr[pos]])
                tmp.remove(pos)
                # if(0 in tmp):
                #     found = True
                #     break
                newLocations.extend(tmp)
                if(0 in newLocations):
                    found = True
                    break
            if(found):
                break
            t_newLocations = copy.deepcopy(newLocations)
            for location in newLocations:
                if(location in visited):
                    t_newLocations.remove(location)
            locations = copy.deepcopy(t_newLocations)
            visited.extend(t_newLocations)
        if(found):
            return steps
        else:
            return float('inf')
    def __init__(self) -> None:
        self.visited = {}
        self.jumps = False
        self.table = {}

    def createDictionary(self, arr):
        table = {}
        jumps = False
        for index,num in enumerate(arr):
            if(num in table):
                jumps = True
                table[num].append(index)
            else:
                table[num] = [index]
        return table, jumps

    def jumps(self, arr, table, pos, steps, paths):
        print(paths)
        if(pos == len(arr)-1):
            return steps
        
        if(pos < 0):
            return float('inf')
        
        if(pos >= len(arr)):
            return float('inf')
        
        if(pos in self.visited and self.visited[pos] < steps):
            return float('inf')
        
        self.visited[pos] = steps

        nextPos = set([pos+1, pos-1])
        if arr[pos] in table:
            equals = copy.deepcopy(table[arr[pos]])
            equals.remove(pos)
            nextPos.update(equals)
        nextPos = list(nextPos)
        nextPos.sort(reverse=True)
        
        minStep = float('inf')
        for item in nextPos:
            if(item in self.visited and self.visited[item] < steps+1):
                continue
            new_path = copy.deepcopy(paths)
            new_path.append(item)
            currentStep = self.jumps(arr, table, item, steps + 1, new_path)
            if(currentStep < minStep):
                minStep = currentStep
        
        return minStep

    def minJumps(self, arr: List[int]) -> int:
        table = self.createDictionary(arr)
        self.table, self.jumps = table
        path = [0]
        # return self.jumps(arr, table, 0, 0, path)
        return self.jumps2(arr)

